SET NAMES utf8mb4;
SET FOREIGN_KEY_CHECKS = 0;

-- ----------------------------
-- Table structure for employees
-- ----------------------------
DROP TABLE IF EXISTS `employees`;
CREATE TABLE `employees` (
  `id` varchar(10) NOT NULL COMMENT 'id karyawan hanya untuk konsumsi komputer dan programmer',
  `nik` varchar(16) CHARACTER SET latin2 COLLATE latin2_general_ci DEFAULT NULL COMMENT 'nomor induk karyawan',
  `name` varchar(40) DEFAULT NULL COMMENT 'nama lengkap karyawan',
  `birth_place` varchar(30) DEFAULT NULL COMMENT 'tempat lahir',
  `birth_date` date DEFAULT NULL COMMENT 'tanggal lahir',
  `division` varchar(10) DEFAULT NULL COMMENT 'Divisi karyawan bekerja',
  `gender` enum('L','P') DEFAULT 'L' COMMENT 'L laki-laki, P Perempuan',
  `religion` int DEFAULT NULL COMMENT 'agama kepercayaan',
  `education_level` enum('SD','SMP','SMA','DIPLOMA','SARJANA','MASTER','DOKTORAL','PROFESOR','LAIN-LAIN') DEFAULT NULL COMMENT 'Level Pendidikan',
  `address` varchar(255) DEFAULT NULL COMMENT 'alamat tempat yang ditinggali',
  `phone_number` varchar(18) DEFAULT NULL COMMENT 'nomor telepon seluler',
  `npwp_number` varchar(25) DEFAULT NULL COMMENT 'nomor npwp pribadi',
  `email` varchar(45) DEFAULT NULL,
  `joint_date` date DEFAULT NULL,
  `end_date` date DEFAULT NULL,
  `employee_type` enum('Tetap','Kontrak') DEFAULT NULL,
  `status` enum('1','0') DEFAULT '1' COMMENT 'status customer aktif atau tidak',
  `created_at` datetime DEFAULT NULL,
  `modified_at` datetime DEFAULT NULL,
  `created_by` int DEFAULT NULL,
  `modified_by` int DEFAULT NULL,
  `deleted_at` datetime DEFAULT NULL,
  `deleted_by` int DEFAULT NULL,
  `bank_account_number` varchar(50) DEFAULT NULL,
  `branch_code` varchar(4) DEFAULT NULL,
  `bank_name` varchar(255) DEFAULT NULL,
  `signature` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  KEY `FK_datak_pendidikan` (`education_level`) USING BTREE,
  KEY `Index_8` (`name`,`birth_date`) USING BTREE,
  KEY `divisi` (`division`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=DYNAMIC;

